import React from 'react'
import Number from '../Number'


export default function Numbers({numbers}) {
  return (
    <div>
      {numbers.map(number => {
        return (
          < Number key={number.id}/>
        )
      })}
    </div>
  )
}

const styles = {
  container: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
  }
}
